// client/src/components/ShieldEntry.js
import React, { useState } from 'react';

const ShieldEntry = () => {
  const [shieldTime, setShieldTime] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle shield time submission
    console.log('Shield time submitted:', shieldTime);
  };

  return (
    <div>
      <h2>Enter Shield Time</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="datetime-local"
          value={shieldTime}
          onChange={(e) => setShieldTime(e.target.value)}
        />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default ShieldEntry;
